import styled from "styled-components";
import { ImageContainer, RowSpaceBetween } from "../styled";
import Logo from "../assets/images/logo.png";

const Header = () => {
    return (  <HeaderWrapper>
        <ImageContainer width="50px" height="50px" src={Logo}/>
    </HeaderWrapper>);
}

export default Header;
const HeaderWrapper = styled(RowSpaceBetween)`
max-height: 80px;
min-height: 80px;
border-bottom: 1px solid rgba(180, 180, 180, 1);width: 100vw;
height: 100%;
`;
